-- ----------------------------
-- Table structure for feel_customer
-- ----------------------------
DROP TABLE IF EXISTS `feel_customer`;
CREATE TABLE `feel_customer` (
  `customer_id` int(10) unsigned NOT NULL AUTO_INCREMENT,
