  `webchat_seller` varchar(32) NOT NULL DEFAULT '',
  `have_feelcard` int(10) NOT NULL DEFAULT '0' COMMENT '是否有名片 1 有',
  `feelec_merchant_id` varchar(30) NOT NULL DEFAULT '' COMMENT '关联商户id',
