  KEY `customer_id_index` (`company_id`,`isvalid`) USING BTREE,
  KEY `member_id_index` (`member_id`) USING BTREE,
  KEY `first_contact_id_index` (`first_contact_id`) USING BTREE,
  KEY `is_trade_index` (`is_trade`) USING BTREE,
  KEY `lastfollowtime_index` (`lastfollowtime`) USING BTREE
) ENGINE=MyISAM DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC;

