-- ----------------------------
-- Table structure for feel_define_form
-- ----------------------------
DROP TABLE IF EXISTS `feel_define_form`;
CREATE TABLE `feel_define_form` (
  `form_id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `company_id` int(10) unsigned NOT NULL DEFAULT '0',
  `type` enum('contract','product','contacter','order','analysis','competitor','shipment','customer','clue','opportunity') NOT NULL COMMENT 'customer 客户\r\nclue 线索\r\nopportunity 商机\r\ncontacter 联系人\r\ncontract 合同\r\nproduct 产品\r\norder 订单\r\nanalysis 客户分析\r\ncompetitor 竞争对手\r\nshipment 出货',
  `form_name` varchar(50) NOT NULL DEFAULT '',
  `form_description` varchar(128) NOT NULL DEFAULT '' COMMENT '字段名',
  `name_en` varchar(128) NOT NULL DEFAULT '' COMMENT '字段英文名',
  `name_jp` varchar(128) NOT NULL DEFAULT '' COMMENT '字段日文名',
  `form_explain` varchar(128) NOT NULL DEFAULT '',
  `form_type` varchar(20) NOT NULL DEFAULT '' COMMENT 'text 单行文本\r\ntextarea 多行文本\r\nradio 单项选择\r\ncheckbox 多项选择\r\nselect 下拉选择\r\nselect_text 下拉填写\r\ndate 时间组件\r\nregion 地区组件\r\nphone 手机\r\nemail 邮箱\r\nnumber 数字',
  `form_option` text,
  `is_required` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否必填 0 必填 1选填',
  `closed` tinyint(1) NOT NULL DEFAULT '0',
  `is_unique` tinyint(1) NOT NULL DEFAULT '0' COMMENT '1,防止重复',
  `show_list` tinyint(1) NOT NULL DEFAULT '0' COMMENT '1列表显示',
  `role_id` varchar(50) DEFAULT NULL COMMENT '查看范围-角色',
  `member_id` varchar(50) DEFAULT NULL COMMENT '修改权限-用户',
  `orderby` int(10) unsigned NOT NULL DEFAULT '0',
  `is_default` tinyint(1) NOT NULL DEFAULT '0' COMMENT '1为默认字段',
  PRIMARY KEY (`form_id`) USING BTREE,
  KEY `define_form_index` (`company_id`,`type`,`closed`) USING BTREE,
  KEY `form_name_index` (`form_name`) USING BTREE,
  KEY `form_type_index` (`form_type`) USING BTREE,
  KEY `is_required_index` (`is_required`) USING BTREE,
  KEY `is_unique_index` (`is_unique`) USING BTREE,
  KEY `show_list_index` (`show_list`) USING BTREE
) ENGINE=MyISAM AUTO_INCREMENT=63 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC;

-- ----------------------------
-- Records of feel_define_form
-- ----------------------------
BEGIN;
COMMIT;

