  `new_order_notify` tinyint(2) NOT NULL DEFAULT '10' COMMENT '新订单通知',
  `order_notifier` varchar(20) NOT NULL DEFAULT '0' COMMENT '新订单通知',
  `nofollow_customer_notify` tinyint(2) NOT NULL DEFAULT '10' COMMENT '未跟进客户通知',
