DROP TABLE IF EXISTS `feel_shipment`;
CREATE TABLE `feel_shipment` (
  `shipment_id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `company_id` int(10) unsigned NOT NULL DEFAULT '0',
  `customer_id` int(10) unsigned NOT NULL COMMENT '客户id',
  `product_id` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '产品id',
  `num` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '数量',
  `money` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '总金额',
  `isvalid` tinyint(1) NOT NULL DEFAULT '1' COMMENT '是否有效 1 有效',
  `creater_id` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '创建人id',
  `createtime` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '创建时间',
  PRIMARY KEY (`shipment_id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC;

