-- ----------------------------
-- Table structure for feel_upload_file
-- ----------------------------
DROP TABLE IF EXISTS `feel_upload_file`;
CREATE TABLE `feel_upload_file` (
  `file_id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `company_id` int(10) unsigned NOT NULL DEFAULT '0',
  `contract_id` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '合同id',
  `clue_id` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '线索id',
  `customer_id` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '客户id',
  `opportunity_id` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '商机id',
  `follow_id` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '跟进记录id',
  `file_link` varchar(255) DEFAULT NULL,
  `save_name` varchar(255) NOT NULL DEFAULT '' COMMENT '储存的文件明',
  `file_name` varchar(255) DEFAULT NULL,
  `file_size` int(10) DEFAULT NULL,
  `file_type` varchar(10) DEFAULT NULL,
  `file_form` varchar(30) DEFAULT NULL COMMENT 'contract 合同附件  follow 跟进记录附件',
  `create_time` int(10) unsigned NOT NULL DEFAULT '0',
  PRIMARY KEY (`file_id`) USING BTREE,
  KEY `upload_file_index` (`company_id`,`contract_id`,`file_form`) USING BTREE
) ENGINE=MyISAM DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC;

